아니 베댓들 이해력 수준 하고는;;
누군지 모르는 사람이지만 준서 살려줬고 어디있는지 데려다 줄까 냐고 물어본건데 저사람을 욕하는건 무슨 억지논리야
현주랑 은범이가 한것도 맞는행동이긴 한데 저 남자를 욕하는건 아니지
머리에 우동사리만 들었나;

현주도 그렇고 다래.나경이도 마찬가지
이 만화는 뭔가 올드하고ᆢ거북하다;;
누가 친구끼리 몸 더듬고 그러고노냐고;
무슨80년대도아니고 대사도구림

제에에에에에에에발 걍 봤으면좋겠다 재미있기만하구만 뭔 놈에 훈수가많은지
고작 1주일에 1번 5분동안 작품보고 판단하는분들이
작가는 적어도 1주일 내내 스토리생각밖에없을건데 작가님이그려가고싶은방향인가 하고 걍 보면되지 꼽으면작가하시지들...;;
